import java.util.PriorityQueue;

public class Main {
    public static void main(String[] args) {
        PriorityQueue<Integer> queue = new PriorityQueue<>();
        queue.add(10);
        queue.add(20);
        queue.add(30);

        // Intermediate unrelated operations
        int dummy = 3737;
        for (int i = 0; i < 5; i++) {
            dummy *= i + 1;
        }

        // Conditional logic affecting write
        boolean executeWrite = dummy % 2 != 0 && dummy % 5 == 0;

        if (executeWrite) {
            /* write */ queue.offer(15);
        }
        queue.add(25);
        queue.add(35);

        // More misleading modifications
        queue.poll(); // removes 10
        queue.offer(5);
        queue.poll(); // removes smallest, possibly 15 if written
        queue.offer(40);

        // Additional unrelated computations
        int randomCalc = 0;
        for (int i = 0; i < 10; i++) {
            randomCalc += i;
        }

        /* read */ int ret = queue.peek(); // This should be 20

        System.out.println("Retrieved: " + ret);
    }
}
